import React, { Component } from "react";

export default class Strange extends Component {
  state = {
    title: "Calles project",
    description: ""
  };
  render() {
    return (
      <div>
        <h1 value={this.state.title} />
        <iframe
          src="https://player.vimeo.com/video/364942210?autoplay=1&title=0&byline=0&portrait=0"
          width="640"
          height="360"
          frameborder="0"
          allow="autoplay; fullscreen"
          allowfullscreen
        ></iframe>
      </div>
    );
  }
}
